import React from 'react';
import { Link } from 'react-router-dom';

const obj = {};
function MachineItem({ asset = obj }) {
  const url = `/${asset.id}`;
  return(
    <li class="ml-8 mr-8 border bg-gray-900">
      <Link to={url}>
        <span class="">{Number(asset.healthscore)}%</span>
        <span class="">{asset.name}</span>
        <span class="">{asset.sensors}</span>
      </Link>
    </li>
  );
}

export default MachineItem;
